import "./App.css";
import UserInput from "./UserInput/UserInput";
import UserOutput from "./UserOutput/UserOutput";

function App() {
  return (
    <div>
      <UserInput />
      <UserOutput userName="Darcy Xie"/>
    </div>
  );
}

export default App;
